import React from "react";
import { Box, Typography, Link, Container } from "@mui/material";


const Footer = () => {
  return (
    <Box
      sx={{
        height: "20vh",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <Container maxWidth='md'>
      <Box></Box>>
      </Container>
    </Box>
  );
};

export default Footer;
